import base64
import hashlib
from Crypto.Cipher import AES


def evp_bytes_to_key(password: bytes, salt: bytes, key_len: int, iv_len: int):
    """
    Reproduziert exakt CryptoJS/OpenSSL EVP_BytesToKey (MD5-Kaskade).
    """
    d = b""
    last = b""

    while len(d) < (key_len + iv_len):
        last = hashlib.md5(last + password + salt).digest()
        d += last

    return d[:key_len], d[key_len:key_len+iv_len]


def decrypt_cryptojs(ciphertext_b64: str, password: str) -> str:
    """
    Entschlüsselt jeden CryptoJS/OpenSSL AES-String mit 'Salted__' Header.
    """
    raw = base64.b64decode(ciphertext_b64)

    if raw[:8] != b"Salted__":
        raise ValueError("Kein gültiger CryptoJS/OpenSSL 'Salted__' Header.")

    salt = raw[8:16]
    enc_data = raw[16:]

    key, iv = evp_bytes_to_key(password.encode(), salt, 32, 16)

    cipher = AES.new(key, AES.MODE_CBC, iv)
    decrypted = cipher.decrypt(enc_data)

    # PKCS7 Unpadding
    pad = decrypted[-1]
    decrypted = decrypted[:-pad]

    return decrypted.decode("utf-8")


